import React from "react";
import { Link } from "react-router-dom";
import SortAge from "../components/SortAge";

const style = {
  display: "flex",
  flexDirection: "colomn",
};

function Home() {
  return (
    <div>
      <h1>React Daily Challenges</h1>
      <p style={style}>
        <Link to="/sortage">Day 1</Link>
        <Link to="/search">Day 2</Link>
      </p>
    </div>
  );
}

export default Home;
